import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Checkbox from '@material-ui/core/Checkbox';


const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
    imageDiv:{
        padding: "10px",
        border: "1px solid black"
    },

}));

export default function FolderList() {
    const classes = useStyles();

    return (
        <List className={classes.root}>
        <ListItem>
            <ListItemText primary="Product Id" secondary="33246" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Product Created On" secondary="9 April 2019" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Product Title" secondary="Steelbird Air" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Product Name" secondary="Devil Face" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Price" secondary="3000" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Manufacturing Date" secondary="20 July 2019" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Expiry Date" secondary="30 December 2024" />
        </ListItem>
        <ListItem>
        </ListItem>
        <ListItem>
            <ListItemText primary="Warranty" secondary="365 Days" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Status" secondary="Active" />
        </ListItem>
        </List>
    );
}
